import React, { Component } from 'react';
import style from './Container.module.css';
import Radium from 'radium';

class container extends Component {
    state = {
        modalIsOpen: false,
    }
    render (){
        return (        
        <div className={style.container}>
        </div>
        );
    }
}

export default Radium(container);
